import React from 'react';
import './componentcss.css';

class dataPrint extends React.Component {
    constructor() {
        super();
        this.handleClick = this.handleClick.bind(this);
        this.state = {
         data: 0
        }
     }
     handleClick(person) {

      this.setState({
         data: person.id
      })

   }

    render() {

       return (
          <tr className={this.props.data.id}  onMouseOver={() => this.handleClick(this.props.data)}>

             <td>{this.props.data.id}</td>
             <td>{this.props.data.index}</td>
             <td>{this.props.data.kridit}</td>
             <td>{this.props.data.lesson_name}</td>
             <td>{this.props.data.parent}</td>
             <td>{this.props.data.level}</td>
             <td>{this.props.data.season}</td>
             <td>{this.props.data.consumption}</td>
          </tr>
       );
    }
 }



export default dataPrint;
